d-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/62124/">我妈妈的朋友</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%EC%84%9C%EC%9B%90------------/" target="_blank">서원</a>&nbsp;<a href="/s/-%EB%A6%AC%EC%82%AC------------/" target="_blank">리사</a>&nbsp;<a href="/s/-%ED%95%98%EC%95%BC%EC%8B%9C------------/" target="_blank">하야시</a>&nbsp;<a href="/s/-%EC%97%84%EA%B8%B0%EC%98%81------------/" target="_blank">엄기영</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EC%9D%B4%EC%A7%84%EB%AA%85--------/" target="_blank">이진명</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主妈妈给男主断了经济来源，还委托男主寄宿在姨母家里，而姨母家里有个同样寄宿的日本女学生，两人很快擦起了火花，但男主却对姨母产生了真实的感情，而姨母却饱受猥琐房东的猥亵，经常被房东揩油，甚至还进行强迫做爱，姨母忍气吞声，也对男主产生了依恋，两人情投意合发生了关系，而这一切也被日本女学生发现，她为了抢</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/62124/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/61751/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-11-10/201811101541834468.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280韩语中字</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/61751/">年轻妈妈的朋友</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%EC%A7%80%EC%84%B1------------/" target="_blank">지성</a>&nbsp;<a href="/s/-%EC%A7%80%ED%98%9C------------/" target="_blank">지혜</a>&nbsp;<a href="/s/-%EC%9C%A0%EC%84%A4%EC%98%81------------/" target="_blank">유설영</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EC%9C%A0%ED%95%B4%EC%A2%85--------/" target="_blank">유해종</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主刚退伍回来，没有找到住处，借住在阿姨家里，阿姨跟表妹都是两个放荡的女人，对男主的成熟健壮的身体非常喜欢，表妹肤白貌美，一双大长腿非常撩人，她意外发现男主在打飞机后，幻想出兄妹两人极度羞涩的乱伦性爱，而就在两个女人对男主垂涎不已的时候，男主竟然带来了自己的女友，这让阿姨非常嫉妒，她决定必须迈出一步</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/61751/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/60144/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-09-21/201809211537526728.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280韩语中字</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/60144/">妈妈的朋友们2</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%87%91%E7%8F%A0------------/" target="_blank">金珠</a>&nbsp;<a href="/s/-Joo------------/" target="_blank">Joo</a>&nbsp;<a href="/s/-Jin------------/" target="_blank">Jin</a>&nbsp;<a href="/s/-%EC%9D%B4%EC%A4%80%ED%98%84------------/" target="_blank">이준현</a>&nbsp;<a href="/s/-%EB%8F%84%EB%AA%A8%EC%84%B8------------/" target="_blank">도모세</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EC%9E%84%ED%98%84%ED%83%9C--------/" target="_blank">임현태</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主的妈妈