xt-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主是一个约19岁的男生，妈妈要出去然后让他寄住在朋友家里，那个女人身材很好，男生意淫，后来偶然发现女人和其他男人偷情，结果更加欲罢不能，一路跟着女人偷窥，发现女人还和一个男人在试衣间激战，上演三里屯剧情，后来，男人经不住诱惑和女人上了床后来他发现女人任然在和其他人搞，两人就大吵了一架，分手了，男主</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/59839/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/57699/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-08-07/201808071533630673.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280韩语中字</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/57699/">罗曼史：妈妈的朋友</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%EC%9D%B4%EC%9D%80%EB%AF%B8------------/" target="_blank">이은미</a>&nbsp;<a href="/s/-%EB%B0%95%EC%A3%BC%EB%B9%88------------/" target="_blank">박주빈</a>&nbsp;<a href="/s/-%EC%9C%A0%EC%84%A4%EC%95%84------------/" target="_blank">유설아</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EC%9C%A0%ED%95%B4%EC%A2%85--------/" target="_blank">유해종</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主跟自己的好友两人对性爱非常感兴趣，但是却都没有体验过，男主家中突然搬来了一个美丽的单身姨母，男主将她当做了意淫对象，常常幻想她来打飞机，而终于有一次被姨母撞见，姨母不但没有生气，还愿意教男主如何做爱.....男主的好友一直想勾引学生妹来上床，也总是被拒绝，伤心绝望之际，突然收到了一个女生的相约，</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/57699/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/32557/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2017-09-22/201709221506052646.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/32557/">善良妈妈的朋友</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%EC%A1%B0%EC%99%84%EC%A7%84------------/" target="_blank">조완진</a>&nbsp;<a href="/s/-%E6%9D%8E%E9%87%87%E6%BD%AD------------/" target="_blank">李采潭</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EA%B3%BD%EC%98%81%EA%B7%BC--------/" target="_blank">곽영근</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>　　姐姐一样的年轻妈妈尹和刚满二十岁的儿子线材。新买的，他们就是住在隔壁的帽子和同龄。就是不允的朋友荣州和她的儿子在二十岁。刚开始只是朋友的妈妈阿姨给你的儿子们。最后他们瞒着妈妈，儿子，汤姆偷偷地开始。</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/32557/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/56572/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-07-20/201807201532086714.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">5.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280韩语中字</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/56572/">妈妈的朋友4</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%EC%A7%80%EC%97%B0------------/" target="_blank">지연</a>&nbsp;<a href="/s/-%EC%9C%A0%EB%A6%AC------------/" target="_blank">유리</a>&nbsp;<a href="/s/-%EC%8B%9C%ED%9B%84------------/" target="_blank">시후</a>&nbsp;<a href="/s/-%EC%83%81%EC%9A%B0------------/" target="_blank">상우</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed